import React, { useContext } from 'react'
import './CSS/styles.css'
import MainWeather from '../Components/MainWeather/MainWeather'
import Visibility from '../Components/Visibility/Visibility'
import Humidity from '../Components/Humidity/Humidity'
import Pressure from '../Components/Pressure/Pressure'
import Wind from '../Components/Wind/Wind'
import Daily from '../Components/Daily/Daily'
import { WeatherContext } from '../Context/WeatherContext'

const Home = () => {
    const { weather } = useContext(WeatherContext)

    console.log(weather, " --> weather in home.jsx")
    // const weatherData = weather.find((e) => 
    //     console.log(e, " I am e")
    // )

    const weatherData = []

    for (const data in weather) {
        // console.log(`${data}: ${weather[data]}`)
        // console.log(JSON.stringify(data), " ---> data")
        weatherData.push({data: weather[data]})
    }

    console.log(weatherData)

    return (
        <div className='home'>
            <div className="main-w">
                <MainWeather weather={"weatherData"}/>
            </div>

            <div className="weather-descriptions">
                <Visibility weather={"weatherData"}/>
                <Humidity weather={"weatherData"}/>
                <Pressure weather={"weatherData"}/>
                <Wind weather={"weatherData"}/>
                <Daily weather={"weatherData"}/>
            </div>
        </div>
    )
}

export default Home
